import SliderPart from '../components/slaider/Slider';
import AboutSite from '../components/aboutSite';
import ExtraMenu from '../components/extraMenu';
import Footer from '../components/footer';




const HomePage = () => {


  return (
    <div>
    <TopPart/>
    <MainPart/>
